  FormaPagamentoContainer,
  Title,
  FormaPagamentoLabel,
  IconContainer,
  Icon,
  Button,
} from "./styles";
import { Props } from "./types";

const FormaPagamento: React.FC<Props> = () => {
  return (
    <Container>
      <Title>Como você prefere pagar?</Title>
      <FormaPagamentoContainer>
        <IconContainer>
          <Icon />
        </IconContainer>
        <FormaPagamentoLabel>Cartão Nubank ****6983</FormaPagamentoLabel>
        <RadioBox isSelected={false} />
      </FormaPagamentoContainer>
      <FormaPagamentoContainer>
        <IconContainer>
          <Icon />
        </IconContainer>
        <FormaPagamentoLabel>Cartão PicPay ****6739</FormaPagamentoLabel>
        <RadioBox isSelected={false} />
      </FormaPagamentoContainer>
      <Button onClick={() => alert("Finalizado")}>Finalizar compra</Button>
    </Container>
  );
};

export default FormaPagamento;
